import React,{useState,useEffect} from "react"
function App() {
  const [html, sethtml] = useState()


  useEffect(() => {
    fetch('/time/2').then(res => res.json()).then(data => {

      const b = data.time.split("[")
      sethtml(b)
    });
  }, []);

  return (
    <>
      {html}
    </>
  );
}

export default App;
